package com.wind.mybatis.pojo;import javax.persistence.*;@Table(name = "ticket_table")public class Ticket {    @Id    private Integer id;    @Column(name = "NAME")    private String name;    private Double price;    @Column(name = "travelDays")    private Double traveldays;    @Column(name = "travePeoples")    private Integer travepeoples;    private String inco;    /**     * @return id     */    public Integer getId() {        return id;    }    /**     * @param id     */    public void setId(Integer id) {        this.id = id;    }    /**     * @return NAME     */    public String getName() {        return name;    }    /**     * @param name     */    public void setName(String name) {        this.name = name;    }    /**     * @return price     */    public Double getPrice() {        return price;    }    /**     * @param price     */    public void setPrice(Double price) {        this.price = price;    }    /**     * @return travelDays     */    public Double getTraveldays() {        return traveldays;    }    /**     * @param traveldays     */    public void setTraveldays(Double traveldays) {        this.traveldays = traveldays;    }    /**     * @return travePeoples     */    public Integer getTravepeoples() {        return travepeoples;    }    /**     * @param travepeoples     */    public void setTravepeoples(Integer travepeoples) {        this.travepeoples = travepeoples;    }    /**     * @return inco     */    public String getInco() {        return inco;    }    /**     * @param inco     */    public void setInco(String inco) {        this.inco = inco;    }    @Override    public String toString() {        return "Ticket{" +            "id=" + id +            ", name='" + name + '\'' +            ", price=" + price +            ", traveldays=" + traveldays +            ", travepeoples=" + travepeoples +            ", inco='" + inco + '\'' +            '}';    }}